# Tsada, Republic of Dagestan

}}
Tsada () is a rural locality (a selo) in Khunzakhsky District, Republic of Dagestan, Russia. Population:  There are 3 streets in this selo.
Geography
It is located 3&nbsp;km from Khunzakh (the district's administrative centre), 78&nbsp;km from Makhachkala (capital of Dagestan) and 1,644&nbsp;km from Moscow. Arani is the nearest rural locality.
